import React, { useState, useEffect } from "react";

function App() {
    const [data, setData] = useState([{}]);

    useEffect(() => {
        fetch("/fakeData")
            .then((res) => {
                return res.json();
            })
            .then((data) => {
                setData(data);
                console.log(data);
            });
    }, []);

    return <div className="App">Hello Yams</div>;
}

export default App;
